#!/usr/bin/env python3
dna_mixed=""
dna=dna_mixed.upper()
dna_At=dna.replace("A","t")
dna_Ta=dna_At.replace("T","a")
dna_Gc=dna_Ta.replace("G","c")
dna_Cg=dna_Gc.replace("C","g")
comp=dna_Cg.upper()
rev_comp=comp[::-1]
sequences="" "Original Sequence 5' {} 3'"'\n'"Complement 5' {} 3'" '\n' "Reverse Complement 5' {} 3'" ""
print(sequences.format(dna,comp,rev_comp))

